#### Core Topics and Concepts

1. **Descriptive Statistics**
   - **Measures of Central Tendency**: Mean, Median, Mode
   - **Measures of Dispersion**: Range, Interquartile Range (IQR), Variance, Standard Deviation
   - **Data Visualization**: Stem-and-Leaf Plots, Bar Charts, Pie Charts

2. **Inferential Statistics**
   - **Sampling**: Random Sampling, Representative Samples
   - **Association and Correlation**: Covariance, Association between Categorical Variables

3. **Data Types and Scales of Measurement**
   - **Categorical Data**: Nominal, Ordinal
   - **Numerical Data**: Discrete, Continuous
   - **Scales of Measurement**: Nominal, Ordinal, Interval, Ratio

4. **Probability and Distributions**
   - **Frequency Distributions**: Relative Frequency, Cumulative Frequency
   - **Probability Distributions**: Mean, Variance, Standard Deviation

5. **Data Analysis Techniques**
   - **Stem-and-Leaf Plots**: Interpretation and Analysis
   - **Bar Charts and Pie Charts**: Interpretation and Analysis
   - **Covariance and Correlation**: Calculation and Interpretation

#### Important Equations

1. **Mean (Average)**
   \[
   \overline{x} = \frac{\sum_{i=1}^{n} x_i}{n}
   \]

2. **Variance**
   \[
   \sigma^2 = \frac{\sum_{i=1}^{n} (x_i - \overline{x})^2}{n}
   \]

3. **Standard Deviation**
   \[
   \sigma = \sqrt{\frac{\sum_{i=1}^{n} (x_i - \overline{x})^2}{n}}
   \]

4. **Covariance**
   \[
   \text{Cov}(X, Y) = \frac{1}{n} \sum_{i=1}^{n} (X_i - \mu_X)(Y_i - \mu_Y)
   \]

5. **Interquartile Range (IQR)**
   \[
   IQR = Q3 - Q1
   \]
   where \( Q3 \) is the third quartile and \( Q1 \) is the first quartile.

